import React from "react";
import logo from "../logo.svg";

function Project1() {
  return (
    <div className="Project1">
      <img src={logo} className="App-logo" alt="logo" />
      <p style={{backgroundColor: "red", height: "1000px"}}> 
        Project1
      </p>
    </div>
  )
}

export default Project1;
